import Main from "./Main";
import "./styels.css";
function App() {
  return (
    <div>
      <Routes>
        <Route element={<Main />} path="/">
        <Route
              key={value.id}
              Component={value.component}
              path={value.path}
            ></Route>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
